import React from 'react';
import {Link} from 'react-router-dom';
/*import HomeIcon from '@material-ui/core';*/

function Header(){
    return(
            <div class="header">
                
                <div class="inner_header">
                    
                    <div class="logo_container">
                        <a><Link to="/">MY<span class="logo_part">APP</span></Link></a>
                    </div>

                    /*<HomeIcon/>*/

                <ul class="navigation">
                    
                    <li><a><Link to="/products">Produkte</Link></a></li>
                    <li><a href="#"><Link to="/lösungen">Lösungen</Link></a></li>
                    <li><a href="#"><Link to="/tools">Tools</Link></a></li>
                    <li><a href="#"><Link to="/tools">Unternehmen</Link></a></li>
                </ul>
            </div>
            
            </div>
            )
}
export default Header;
